package algorithm.esay;

/**
 *  Given  an  arbitrary  ransom  note  string  and  another  string  containing  letters from  all  the  magazines,  write  a  function  that  will  return  true  if  the  ransom   note  can  be  constructed  from  the  magazines ;  otherwise,  it  will  return  false.
 * <p>
 * Each  letter  in  the  magazine  string  can  only  be  used  once  in  your  ransom  note.
 * <p>
 * Note:
 * You may assume that both strings contain only lowercase letters.
 * <p>
 * canConstruct("a", "b") -> false
 * canConstruct("aa", "ab") -> false
 * canConstruct("aa", "aab") -> true
 * <p>
 * <p>解析:统计字典字符串中a到z字符出现的次数，依次遍历ransom字符，减去使用的字符，若字符库存小于0，则返回false，最后返回true
 *
 * @author chengshaojin
 * @since 2016/9/26.
 */
public class RansomNote {

    public static void main(String[] args) {
        RansomNote r = new RansomNote();
        System.out.println(r.canConstruct("a", "b"));
        System.out.println(r.canConstruct("aa", "ab"));
        System.out.println(r.canConstruct("aa", "aab"));
        System.out.println(r.canConstruct("", ""));
    }

    public boolean canConstruct(String ransomNote, String magazine) {
        int[] appearances = new int[26];
        for (char c : magazine.toCharArray()) {
            appearances[c - 'a']++;
        }
        for (char c : ransomNote.toCharArray()) {
            if (--appearances[c - 'a'] < 0) {
                return false;
            }
        }
        return true;
    }
}
